import React from 'react';
import {useRouter,} from 'next/router';
import Link from 'next/link';

function HomePage() {

    const router = useRouter();

    return (
    <>
      <div>
        <h1>Sell your products with the global, integrated payment network</h1>
        <Link href="/register">
          <a>Get Started</a>
        </Link>
        <br/>
        <Link href="/login">
          <a>Login</a>
        </Link>
        </div>
    </>
    )
  };
  
export default HomePage;
